import './App.css';
import CalendarHeatmapBroken  from "./CalendarHeatmapBroken";

function groupBy(rawData, key) {
    return rawData.reduce(function(previousVal, currentVal) {
        (previousVal[currentVal[key]] = previousVal[currentVal[key]] || []).push(currentVal);
        return previousVal;
    }, {});
};

function App() {

    return (
    <div className="App">
        <header className="App-header" >
          <CalendarHeatmapBroken>

          </CalendarHeatmapBroken>
      </header>
    </div>
  );
}

export default App;
